tool12.detailedDescription:
 シンプル圧縮ツール
 このツールは、ファイルを効率的に圧縮するための便利なツールです。


&lt;section&gt;
 &lt;h2&gt;使い方&lt;/h2&gt;
 &lt;ol&gt;
 &lt;li&gt;&lt;strong&gt;ファイルを選択&lt;/strong&gt;: 「ファイルを選択」ボタンをクリックして、圧縮したいファイルを選択してください。&lt;/li&gt;
 &lt;li&gt;&lt;strong&gt;圧縮タイプを選択&lt;/strong&gt;: 「画像圧縮」または「ZIP圧縮」から選択してください。&lt;/li&gt;
 &lt;li&gt;&lt;strong&gt;目標サイズを設定&lt;/strong&gt;: MB単位で希望の目標サイズを指定してください。&lt;/li&gt;
 &lt;li&gt;&lt;strong&gt;画質を調整&lt;/strong&gt;: スライダーを使って画質を調整してください（0が最低画質、1が最高画質）。&lt;/li&gt;
 &lt;li&gt;&lt;strong&gt;最大の幅/高さを指定&lt;/strong&gt;: 必要に応じて、画像の最大幅や高さをピクセルで設定してください。&lt;/li&gt;
 &lt;li&gt;&lt;strong&gt;圧縮を開始&lt;/strong&gt;: 「圧縮」ボタンをクリックすると、圧縮が始まります。&lt;/li&gt;
 &lt;/ol&gt;
&lt;/section&gt;

&lt;section&gt;
 &lt;h2&gt;注意事項&lt;/h2&gt;
 &lt;ul&gt;
 &lt;li&gt;圧縮するファイルのサイズや画質はトレードオフの関係にあります。適切なバランスを探してください。&lt;/li&gt;
 &lt;li&gt;入力可能なサイズや画質の範囲を超えた場合、エラーメッセージが表示されます。&lt;/li&gt;
 &lt;/ul&gt;
&lt;/section&gt;

&lt;footer&gt;
 &lt;p&gt;ご不明な点がある場合は、お問い合わせください。&lt;/p&gt;
&lt;/footer&gt;
